import './cars.css';
import carImage from '../../images/clemme.jpg';
import {useEffect, useState} from 'react';

const Cars = (props) => {
    const onCarRentsHandler = () => {
        props.carRentsHandler();
    }
    const turtles = [
        {
            name: 102401,
            nickName: "Leo",
            weapon: "Katana",
            imgUrl: "https://upload.wikimedia.org/wikipedia/en/e/ed/Leonardo_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
        },
        {
            name: "Donatello",
            nickName: "Don",
            weapon: "Bo staff",
            imgUrl: "https://upload.wikimedia.org/wikipedia/en/5/5a/Donatello_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
        },
        {
            name: "Michelangelo",
            nickName: "Mikey",
            weapon: "Nunchucks",
            imgUrl: "https://upload.wikimedia.org/wikipedia/en/f/f3/Michelangelo_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
        },
        {
            name: "Raphael",
            nickName: "Raph",
            weapon: "Sai",
            imgUrl: "https://upload.wikimedia.org/wikipedia/en/7/72/Raphael_%28Teenage_Mutant_Ninja_Tutles%29.jpg"
        }
    ]

    function Child({ items }) {
        // Problem:
        // This will error if `items` is null/undefined
        return (
            <>
              {items.map(item => (
                <li key={item.name}>{item.name}</li>
              ))}
            </>
          );
      }
      
      function Parent() {
        // Uninitialized state will cause Child to error out
        const [items, setItems] = useState();
      
        // Data does't start loading
        // until *after* Parent is mounted
        useEffect(() => {
            fetch("http://127.0.0.1:5000/api/v1/car/catalog", 
            {
            method: 'GET',
            }
              )
            .then(res => res.json())
            .then(data => setItems(data));
        }, []);
      
        // Solution:
        // don't render Child until `items` is ready!
        return (
          <div>
            <p>dzfxb fv</p>
            {items && <Child items={items}/>}
          </div>
        );
      }
    return(
        <div className="cars">
          <div className="cars_row">
           {Parent}
          </div>
          <div className="navi">
            
              <ul className="navi__row">
                <li className="navi__item"><a>1</a></li>
                <li className="navi__item"><a>2</a></li>
                <li className="navi__item"><a>3</a></li>
                <li className="navi__item"><a>4</a></li>
                <li className="navi__item"><a>â†’</a></li>
              </ul>

          </div>
     </div>
    )
}

export default Cars;
